import Movie from './movie';
import movieList from '../data/movielist';
import '../styles/style.scss';

class App extends React.Component {
    render() { 

        return (  
            <React.Fragment>
                {
                movieList.map((element,id) => {
                return (<Movie id = {id} data = {element}/>)
                })
                }
            </React.Fragment>
        );
    }
}

export default App;
